import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <main>
    <Switch>
      <Route exact path='/' component={Home} />
      <Route exact path='/1' component={Page1}/>
      <Route exact path='/2' component={Page2} />
      <Route exact path='/3' component={Page3} />
    </Switch>
  </main>
  );
}

export default App;
